    const instance = axios.create({
        baseURL: 'http://localhost:1337',
        timeout: 1000,
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
    });
    const onSubmit = (data) => {
        instance.get('/users/')
            .then(function (response) {
            })
            .catch(function (error) {
                if (error.response) {
                    console.log(error.response.data);
                    history.push('/login')
                }
            });
    };

    return (
        <div>
            {onSubmit()}
        </div>
    )

}

export default Api;
